import React, {Component} from 'react';
import logo from './images/logo.png';
export default class Header extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <header className="admin__header">
                <a href="#" className="logo">
                    <img src={logo} alt="logo"/>
                </a>
            </header>
        );
    }
}
